src.component.Task.AlterDdlTask.CreateMo:
Before switching the table name, lock the original table to prohibit writes. Please ensure that your database meets the following conditions:  
    1. OceanBase Version ≥ 4.2.5 and < 4.3.0, and the enable_lock_priority parameter has been set to true.
    2. ODP Version ≥ 4.3.1 and the following parameter settings have been made:  
        alter proxyconfig set proxy_id=1;
        alter proxyconfig set client_session_id_version=2;
        alter proxyconfig set enable_single_leader_node_routing = false;
